                <Card
                    title={'Configuration 2'}
                    text={"Today's New's Source"}
                    isCollapsed={isCollapsedCard}
                    setIsCollapsed={setIsCollapsedCard}
                >
                    Nat config 2
                </Card>
                <CreateCard />
            </div>
            <EditCard isCollapsed={isCollapsedCard} setIsCollapsed={setIsCollapsedCard} />
            {/*<Drawer isCollapsed={isCollapsedCard} setIsCollapsed={setIsCollapsedCard}>*/}
            {/*    Configurations*/}
            {/*</Drawer>*/}
        </>
    );
};

Configurations.propTypes = {};

export default Configurations;
